window.bookSummaryJSON = "<p><b>Chaos is on her throne. All's right with the world.</b></p> <p>The Dominion is reclaimed after a lengthy and costly battle, but the war for the fate of the world is far from over. Looming on the horizon are the few, yet overwhelming, obstacles to lasting peace. It is time to confront the remaining Old Humans and bring an end to their reign once and for all.</p> <p>The final war takes Chaos and her comrades to their physical and mental limits and, ultimately, even across space. At the edge of reality, the hidden truth about Old Humanity and Chaos's origins is finally revealed. With her lovers, siblings, and friends by her side, she will have to overcome the greatest test the universe can throw at her.</p> <p><i>Pierce the Heavens</i> is the final volume of the Demon Princess Magical Chaos saga. In the battle for everything dear to her, our lovable Cosmic Horror will be brought to the brink of sanity and beyond. At the end of ends, she will face her true destiny.</p>"; 
